import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import "./Styles/Index.scss";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <div className="container">
      <App />
    </div>
  </React.StrictMode>
);
